import axios from 'axios'

const BASE_URL = "https://api.spoonacular.com/recipes"

class Products {
    static async getRandomProduct() {
        const res = await axios.get("www.themealdb.com/api/json/v1/1/random.php")
        return res
    }
}

export default Products
